INSERT INTO `activity` VALUES (1,'2015-04-01','6:00pm','7:00pm','Computer Skills','adult','computer skill','\"Teen tutors help with basic Internet, Word, Powerpoint, email, and attachments. One-hour sessions are free, space is limited. Tutoring is held in our Computer Training Center. No registration necesssary.\"\r'),(2,'2015-04-01','7:00pm','9:00pm','Poetry Month','\"adult,teen\"','peotry','\"Join us for the Grand Poetry Slam to start off April - Poetry Month!! Featuring an exhibition slam-off between Mighty Mike McGee and Kim Johnson, slam poets extraordinare! Your host is David Perez, SC County Poet Laureate and slam poet. You be the judge of who will be the winning poet!! Made possible thanks to the Friends of the Milpitas Library.\"\r'),(3,'2015-04-07','1:00pm','2:40pm','Ballroom Dancing','adult','dancing','\"Meet a new dance partner and new friends while dancing to the rhythms of Western and Chinese music. Good exercise and good fun! Tuesday afternoons, March 3rd through May 12th (except 3/31, when the Library is closed for Cesar Chavez Day). Free. In our beautiful Auditorium.\"\r'),(4,'2015-04-07','7:00pm','8:00pm','School-Age Stories','school age','stories','Join us on Tuesday evenings at 7 pm for School-Age Stories - a program designed with the older child in mind--longer stories and developmentally appropriate activities for children in grades K to 4th. In the Children\'s Activity Room. (Note in November all programs will be held in the Auditorium for a special series of Puppet Shows.)\r'),(5,'2015-04-14','10:00am','2:00pm','Volunteer Income Tax Assistance','adult ','adult','\"We will be hosting free tax preparation for low income, elderly, disabled and non-English speaking people. All returns, both California and federal, will be filed electronically. Volunteer tax preparers are certified by the IRS. \"\r'),(6,'2015-04-15','7:00pm','8:00pm','Estate Planning','adult','adult ','\"A workshop by Michael Caulking, a Certified Financial Planner, currently an independent advisor with LPL Financial. Michael has worked in the banking environment as well as with other broker dialers and was the Pro-bono Director for the Silicon Valley financial Planning Association. This is the second in a series of three workshops by Michael. The third workshop is in May (see our calendar). Free. In our Auditorium.\"\r'),(7,'2015-04-16','10:30am','11:00pm','Toddler Storytime','toddler','toddler ','Join us at for Toddler Storytime - for children ages 1 year to 3 years. Additional Toddler Storytime is offered at 11:30 am. Note: The program is presented in the Children\'s Activity Room and space is limited.\r'),(8,'2015-04-16','11:00am','11:40am','Guided Meditation','adult','health & fitness','\"Come to our Auditorium and meditate with gentle, relaxing music. You may improve concentration, develop skills more quickly, and increase memory power. Gentle stretching and simple breathing techniques will relax the mind, release tension, and boost energy levels. Deep relaxation will bring awareness to body parts and send a gentle massage to relax the entire body. Wear loose, comfortable clothing and bring a yoga mat, towel, and water bottle\"\r'),(9,'2015-04-16','12:00pm','12:30pm','Baby Storytime','baby','baby','Calling all babies ages newborn to 12 months - come to storytime and meet other babies and rock-a-bye with them in the Children\'s Activity Room. Note: Baby Storytime is an interactive storytime between the baby and caregiver with the storyteller.\r');
/*!40000 ALTER TABLE `activity` ENABLE KEYS */;
UNLOCK TABLES;

